import React, { useEffect } from 'react';
import './CalendlyEmbed.css';

const CalendlyEmbed = () => {
  useEffect(() => {
    // Load Calendly script
    const script = document.createElement('script');
    script.src = 'https://assets.calendly.com/assets/external/widget.js';
    script.async = true;
    document.head.appendChild(script);

    return () => {
      // Cleanup script on unmount
      const existingScript = document.querySelector('script[src="https://assets.calendly.com/assets/external/widget.js"]');
      if (existingScript) {
        document.head.removeChild(existingScript);
      }
    };
  }, []);

  const sessionTypes = [
    {
      id: 'reiki-energy-work',
      name: 'Reiki & Energy Work',
      duration: '60-90 minutes',
      description: 'Restore balance and vitality through gentle energy work',
      url: 'https://calendly.com/kalyanamitta/reiki-energy-work'
    },
    {
      id: 'applied-kinesiology',
      name: 'Applied Kinesiology',
      duration: '60-75 minutes',
      description: 'Muscle testing and healing for body-mind connection',
      url: 'https://calendly.com/kalyanamitta/applied-kinesiology'
    },
    {
      id: 'life-coaching',
      name: 'Life Coaching & Self-Empowerment',
      duration: '60 minutes',
      description: 'Transform your life path with personalized guidance',
      url: 'https://calendly.com/kalyanamitta/life-coaching'
    },
    {
      id: 'spiritual-education',
      name: 'Spiritual Education & Perspective Shifter',
      duration: '60-90 minutes',
      description: 'Expand your perspective and spiritual understanding',
      url: 'https://calendly.com/kalyanamitta/spiritual-education'
    },
    {
      id: 'spiritual-guidance',
      name: 'Spiritual Guidance',
      duration: '75 minutes',
      description: 'Connect with your higher self and spiritual path',
      url: 'https://calendly.com/kalyanamitta/spiritual-guidance'
    },
    {
      id: 'deep-listening',
      name: 'Deep Listening & Support',
      duration: '60 minutes',
      description: 'Supportive presence and active listening',
      url: 'https://calendly.com/kalyanamitta/deep-listening'
    },
    {
      id: 'emotional-processing',
      name: 'Emotional Processing & Upgrading',
      duration: '60-75 minutes',
      description: 'Upgrade your emotional patterns and responses',
      url: 'https://calendly.com/kalyanamitta/emotional-processing'
    },
    {
      id: 'acupressure-massage',
      name: 'Acupressure & Massage',
      duration: '60-90 minutes',
      description: 'Physical healing through touch and pressure points',
      url: 'https://calendly.com/kalyanamitta/acupressure-massage'
    },
    {
      id: 'meditation-teacher',
      name: 'Meditation Teacher',
      duration: '45-60 minutes',
      description: 'Learn meditation techniques for inner peace',
      url: 'https://calendly.com/kalyanamitta/meditation-teacher'
    },
    {
      id: 'yoga-teacher',
      name: 'Yoga Teacher',
      duration: '60-75 minutes',
      description: 'Body and spirit alignment through yoga practice',
      url: 'https://calendly.com/kalyanamitta/yoga-teacher'
    },
    {
      id: 'sound-healing',
      name: 'Sound Healing Teacher',
      duration: '60-90 minutes',
      description: 'Vibrational therapy through sound and music',
      url: 'https://calendly.com/kalyanamitta/sound-healing'
    },
    {
      id: 'breathwork-teacher',
      name: 'Breathwork Teacher',
      duration: '60-75 minutes',
      description: 'Conscious breathing techniques for healing',
      url: 'https://calendly.com/kalyanamitta/breathwork-teacher'
    },
    {
      id: 'piano-improvisation',
      name: 'Piano Improvisation Teacher',
      duration: '60 minutes',
      description: 'Creative musical expression and improvisation',
      url: 'https://calendly.com/kalyanamitta/piano-improvisation'
    },
    {
      id: 'mens-work',
      name: 'Men\'s Work & Issues',
      duration: '75-90 minutes',
      description: 'Masculine development and men\'s specific issues',
      url: 'https://calendly.com/kalyanamitta/mens-work'
    },
    {
      id: 'psychedelic-integration',
      name: 'Psychedelic Education & Integration',
      duration: '90 minutes',
      description: 'Sacred journey support and integration',
      url: 'https://calendly.com/kalyanamitta/psychedelic-integration'
    },
    {
      id: 'sexual-energy-practices',
      name: 'Sexual Energy Practices',
      duration: '75-90 minutes',
      description: 'Sacred sexuality and energy cultivation',
      url: 'https://calendly.com/kalyanamitta/sexual-energy-practices'
    },
    {
      id: 'nature-connection',
      name: 'Connecting to Nature',
      duration: '60-90 minutes',
      description: 'Earth wisdom and natural healing',
      url: 'https://calendly.com/kalyanamitta/nature-connection'
    },
    {
      id: 'software-engineering',
      name: 'Software Engineer',
      duration: '60-90 minutes',
      description: 'Technical guidance and programming support',
      url: 'https://calendly.com/kalyanamitta/software-engineering'
    }
  ];

  const [selectedSession, setSelectedSession] = React.useState(sessionTypes[0]);

  const handleSessionChange = (session) => {
    setSelectedSession(session);
  };

  return (
    <div className="calendly-embed-container">
      <div className="calendly-header">
        <h2>Book Your Session</h2>
        <p>Choose the type of session you'd like to book and select your preferred time.</p>
      </div>

      <div className="calendly-content">
        <div className="session-selector">
          <h3>Select Session Type</h3>
          <div className="session-options">
            {sessionTypes.map((session) => (
              <div
                key={session.id}
                className={`session-option ${selectedSession.id === session.id ? 'selected' : ''}`}
                onClick={() => handleSessionChange(session)}
              >
                <div className="session-info">
                  <h4>{session.name}</h4>
                  <p className="session-duration">{session.duration}</p>
                  <p className="session-description">{session.description}</p>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="calendly-widget">
          <div className="calendly-inline-widget" 
               data-url={selectedSession.url}
               style={{ minWidth: '320px', height: '700px' }}>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CalendlyEmbed;
